import React from "react";
import { BrowserRouter as Router, Route, Routes, Link } from "react-router-dom";
import Home from "./pages/Home";
import RegisterGrievance from "./pages/ComplaintRegistration";
import ViewStatus from "./pages/StatusChecking";
import UploadDocument from "./pages/DocumentUpload";

const App = () => {
  return (
    <Router>
      <Routes>
        <Route path="/" element={<Home />} />
        <Route path="/register" element={<RegisterGrievance />} />
        <Route path="/status" element={<ViewStatus />} />
        <Route path="/upload" element={<UploadDocument />} />
      </Routes>
    </Router>
  );
};

export default App;
